import React from "react";

import { BrowserRouter, Switch, Route } from "react-router-dom";

// components
import Listsalon from "./listofsalons/listsalons";
import Navbarclient from "./Menu/menuclient";
function App() {
  return (
    <BrowserRouter>
      <Navbarclient />
      <Switch>
        <Route exact path="./">
          <Listsalon />
        </Route>
        <Route path="./listrendez-vous"></Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
